import React from 'react';
import PantallaPrincipal from './componentes/PantallaPrincipal/PantallaPrincipal';

import { Route, Routes } from 'react-router-dom';

const App = () => {
  return (
    <div>
      <Routes>
        <Route path="/" element={<PantallaPrincipal/>} />
      </Routes>
    </div>
  );
};

export default App;
